import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <>
    <h1 contentEditable='true'>My name is Gangadhar</h1>
    <a href=''>
      <img src='https://picsum.photos/200/300 ' alt='randomImages' />
    </a>
  </>,
  document.getElementById('root')
);
